import React from 'react';
const { name, price, imageUrl } = item;

const ColletionItem = (item) => (
	<div>
		<img alt={name} src={imageUrl} />
		<span>{name}</span>
		<span>{price} $</span>
		<button>Add To Cart</button>
	</div>
);

export default ColletionItem;
